package com.cellsgame.game.module.hero.cache;

public class HeroProp {
    private Integer hp;

    private Integer speed;

    private Integer attack;

    private Integer defense;

    private Integer magic_defense;

    private Integer technique;

    private Integer luck;

    public Integer getHp() {
        return hp;
    }

    public void setHp(Integer hp) {
        this.hp = hp;
    }

    public Integer getSpeed() {
        return speed;
    }

    public void setSpeed(Integer speed) {
        this.speed = speed;
    }

    public Integer getAttack() {
        return attack;
    }

    public void setAttack(Integer attack) {
        this.attack = attack;
    }

    public Integer getDefense() {
        return defense;
    }

    public void setDefense(Integer defense) {
        this.defense = defense;
    }

    public Integer getMagic_defense() {
        return magic_defense;
    }

    public void setMagic_defense(Integer magic_defense) {
        this.magic_defense = magic_defense;
    }

    public Integer getTechnique() {
        return technique;
    }

    public void setTechnique(Integer technique) {
        this.technique = technique;
    }

    public Integer getLuck() {
        return luck;
    }

    public void setLuck(Integer luck) {
        this.luck = luck;
    }
}
